import React from "react";

const card = props => (
  <div class="col-sm-4">
    <div class="card">
      <div class="card-body">
        <h5 class="card-title">{props.title}</h5>
        <p class="card-text">{props.body}</p>
      </div>
    </div>
  </div>
);

export default card;
